import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
let uri = 'modelJS/model.json'
console.log(uri);
try{
	model = tf.loadLayersModel('modelJS/model.json')
}
catch(e){
	console.log(e);
}
const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
